Stavo iniziando una partita, mentre il gioco accedeva alla lobby io guardavo il telefono, alzo gli occhi e parlando ad alta voce e dico: &quot;dove sono, dove sono a si sono inferiore&quot; nel mentre mio padre passa per il corrodoio e mi guarda parplesso:
Cabbitt: &quot;Em....&quot;
Pap&agrave;: &quot;Tu non sei inferiore devi credere in te stesso, forza&quot; 
Cabbitt: &quot;Guarda pap&agrave; non hai capito...&quot;
Pap&agrave; : &quot;Non ti preoccupare :)&quot;
Cabbitt : &quot;...&quot;
E niente ora credo stia preparando una cena coi fiocchi per tirarmi su... ma lui non ha capito il senso della frase...
